{
  "translationLines": [
    {
      "lineNumber": 122911,
      "originalJapaneseLine": "　　＜くーー……＞",
      "translatedEnglishLine": "   <Grrr...>"
    },
    {
      "lineNumber": 122912,
      "originalJapaneseLine": "謙信のお腹が鳴った。",
      "translatedEnglishLine": "Kenshin's stomach growled."
    },
    {
      "lineNumber": 122913,
      "originalJapaneseLine": "「す、すまない……」",
      "translatedEnglishLine": "\"S-sorry...\""
    },
    {
      "lineNumber": 122914,
      "originalJapaneseLine": "「元々これは謙信のものだしな。",
      "translatedEnglishLine": "\"This was originally Kenshin's, after all."
    },
    {
      "lineNumber": 122915,
      "originalJapaneseLine": "　食べろ食べろ」",
      "translatedEnglishLine": "Eat it, eat it.\""
    },
    {
      "lineNumber": 122916,
      "originalJapaneseLine": "「う、うむ……」",
      "translatedEnglishLine": "\"Y-yes...\""
    },
    {
      "lineNumber": 122917,
      "originalJapaneseLine": "「ふう……」",
      "translatedEnglishLine": "\"Phew...\""
    },
    {
      "lineNumber": 122918,
      "originalJapaneseLine": "「はーっ、やれやれ」",
      "translatedEnglishLine": "\"Haah, good grief.\""
    },
    {
      "lineNumber": 122919,
      "originalJapaneseLine": "「二人とも、お疲れ様です。",
      "translatedEnglishLine": "\"Both of you, good job."
    },
    {
      "lineNumber": 122920,
      "originalJapaneseLine": "　どうぞ、タオルを」",
      "translatedEnglishLine": "Here, take a towel.\""
    },
    {
      "lineNumber": 122921,
      "originalJapaneseLine": "「おっ、ありがてぇ」",
      "translatedEnglishLine": "\"Oh, thanks a lot.\""
    },
    {
      "lineNumber": 122922,
      "originalJapaneseLine": "「ありがとう、愛」",
      "translatedEnglishLine": "\"Thank you, Ai.\""
    },
    {
      "lineNumber": 122923,
      "originalJapaneseLine": "二人は練習として模擬戦をしていた。",
      "translatedEnglishLine": "The two were having a mock battle as practice."
    },
    {
      "lineNumber": 122924,
      "originalJapaneseLine": "「しかし、JAPANの軍神か……",
      "translatedEnglishLine": "\"But, the Military God of JAPAN...\""
    },
    {
      "lineNumber": 122925,
      "originalJapaneseLine": "　軍人の端くれとして名前は聞いていたが、",
      "translatedEnglishLine": "As a fellow soldier, I'd heard the name,"
    },
    {
      "lineNumber": 122926,
      "originalJapaneseLine": "　いやはや、大した強さだ」",
      "translatedEnglishLine": "But man, she's really strong.\""
    },
    {
      "lineNumber": 122927,
      "originalJapaneseLine": "「惜しいな……",
      "translatedEnglishLine": "\"It's a shame...\""
    },
    {
      "lineNumber": 122928,
      "originalJapaneseLine": "　戦局がこんなじゃなきゃ、",
      "translatedEnglishLine": "If the war situation wasn't like this,"
    },
    {
      "lineNumber": 122929,
      "originalJapaneseLine": "　一騎打ちしてみてぇのに」",
      "translatedEnglishLine": "I'd want to try a duel.\""
    },
    {
      "lineNumber": 122930,
      "originalJapaneseLine": "「やり合えば、どっちかが",
      "translatedEnglishLine": "\"If we went at it, one of us"
    },
    {
      "lineNumber": 122931,
      "originalJapaneseLine": "　致命的な傷負うかもしんねぇ。",
      "translatedEnglishLine": "might get a fatal wound."
    },
    {
      "lineNumber": 122932,
      "originalJapaneseLine": "　今はちょっとな……」",
      "translatedEnglishLine": "Not the time right now...\""
    },
    {
      "lineNumber": 122933,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 122934,
      "originalJapaneseLine": "「いえ、もしも……",
      "translatedEnglishLine": "\"No, if... "
    },
    {
      "lineNumber": 122935,
      "originalJapaneseLine": "　やりあえば負けるのは私でしょう」",
      "translatedEnglishLine": "If we fought, the one who would lose is probably me.\""
    },
    {
      "lineNumber": 122936,
      "originalJapaneseLine": "「一合、打ち合えば分かります」",
      "translatedEnglishLine": "\"We'll know after a single exchange.\""
    },
    {
      "lineNumber": 122937,
      "originalJapaneseLine": "「へんっ、よく言うぜ」",
      "translatedEnglishLine": "\"Hmph, you talk big.\""
    },
    {
      "lineNumber": 122938,
      "originalJapaneseLine": "「もしやるなら負けはしねぇって顔してんぜ」",
      "translatedEnglishLine": "\"You're acting like you won't lose if we do it.\""
    },
    {
      "lineNumber": 122939,
      "originalJapaneseLine": "「……嘘をついたつもりはないのだが」",
      "translatedEnglishLine": "\"...I don't mean to lie, though.\""
    },
    {
      "lineNumber": 122940,
      "originalJapaneseLine": "「しっかし、顔と言えば……",
      "translatedEnglishLine": "\"But speaking of your face...\""
    },
    {
      "lineNumber": 122941,
      "originalJapaneseLine": "「剣の腕もそれだけ立つ上に、",
      "translatedEnglishLine": "\"Not only is your swordsmanship outstanding,"
    },
    {
      "lineNumber": 122942,
      "originalJapaneseLine": "　神々しいまでに綺麗とはね……」",
      "translatedEnglishLine": "you're so beautifully divine...\""
    },
    {
      "lineNumber": 122943,
      "originalJapaneseLine": "「神も二物を与えるってわけだ」",
      "translatedEnglishLine": "\"Gods truly bestow two gifts.\""
    },
    {
      "lineNumber": 122944,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 122945,
      "originalJapaneseLine": "「……？」",
      "translatedEnglishLine": "\"... ?\""
    },
    {
      "lineNumber": 122946,
      "originalJapaneseLine": "「いや、お綺麗ですねって、褒めてんだが……」",
      "translatedEnglishLine": "\"No, I was just complimenting you on your beauty...\""
    },
    {
      "lineNumber": 122947,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 122948,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 122949,
      "originalJapaneseLine": "　　＜くーーーー……＞",
      "translatedEnglishLine": "   <Grrr...>"
    },
    {
      "lineNumber": 122950,
      "originalJapaneseLine": "「がくっ……」",
      "translatedEnglishLine": "\"Gah...\""
    },
    {
      "lineNumber": 122951,
      "originalJapaneseLine": "謙信のお腹が鳴った。",
      "translatedEnglishLine": "Kenshin's stomach rumbled."
    },
    {
      "lineNumber": 122952,
      "originalJapaneseLine": "「……すまない」",
      "translatedEnglishLine": "\"...Sorry.\""
    },
    {
      "lineNumber": 122953,
      "originalJapaneseLine": "「すみません、この人、",
      "translatedEnglishLine": "\"I'm sorry, this person"
    },
    {
      "lineNumber": 122954,
      "originalJapaneseLine": "　ニブチンなので……」",
      "translatedEnglishLine": "is a bit slow...\""
    },
    {
      "lineNumber": 122955,
      "originalJapaneseLine": "「そうみたいな……」",
      "translatedEnglishLine": "\"Seems like it...\""
    },
    {
      "lineNumber": 122956,
      "originalJapaneseLine": "「ま、俺も慣れねぇことした。",
      "translatedEnglishLine": "\"Well, I did something I'm not used to."
    },
    {
      "lineNumber": 122957,
      "originalJapaneseLine": "　この嬢ちゃんの表情崩してみたくなってな」",
      "translatedEnglishLine": "I wanted to see this girl's expression change.\""
    },
    {
      "lineNumber": 122958,
      "originalJapaneseLine": "「それなら、焦らなくとも",
      "translatedEnglishLine": "\"If that's the case, no need to rush,"
    },
    {
      "lineNumber": 122959,
      "originalJapaneseLine": "　いずれ見られる機会があるかと」",
      "translatedEnglishLine": "you'll have a chance to see it eventually.\""
    },
    {
      "lineNumber": 122960,
      "originalJapaneseLine": "「おっ？」",
      "translatedEnglishLine": "\"Oh?\""
    },
    {
      "lineNumber": 122961,
      "originalJapaneseLine": "「ランスきーーーっく！」",
      "translatedEnglishLine": "\"Rance Kick!\""
    },
    {
      "lineNumber": 122962,
      "originalJapaneseLine": "「ぎゃーーーーーっ！？」",
      "translatedEnglishLine": "\"Gyaaahhh!?\""
    },
    {
      "lineNumber": 122963,
      "originalJapaneseLine": "「てめぇ、なにしやがんだ、この糞ガキ！」",
      "translatedEnglishLine": "\"You bastard, what the hell do you think you're doing, you damn brat!\""
    },
    {
      "lineNumber": 122964,
      "originalJapaneseLine": "「ランス殿」",
      "translatedEnglishLine": "\"Lord Rance.\""
    },
    {
      "lineNumber": 122965,
      "originalJapaneseLine": "「この中年無精髭が……",
      "translatedEnglishLine": "\"You, this middle-aged scruffy beard...\""
    },
    {
      "lineNumber": 122966,
      "originalJapaneseLine": "　俺の謙信に色目を使いおって……」",
      "translatedEnglishLine": "daring to flirt with my Kenshin...\""
    },
    {
      "lineNumber": 122967,
      "originalJapaneseLine": "「ひゅ〜……」",
      "translatedEnglishLine": "\"Whew...\""
    },
    {
      "lineNumber": 122968,
      "originalJapaneseLine": "「……なんだ？」",
      "translatedEnglishLine": "\"...What?\""
    },
    {
      "lineNumber": 122969,
      "originalJapaneseLine": "「いや、おめぇが命知らずなのは知ってるが、",
      "translatedEnglishLine": "\"I know you're reckless, but"
    },
    {
      "lineNumber": 122970,
      "originalJapaneseLine": "　軍神相手に俺の謙信と来たか……」",
      "translatedEnglishLine": "you really came at my Kenshin against the Military God...\""
    }
  ]
}

